    type: select
    # disable-udp: true
    proxies:
      - DMIT
      - Home
      - DIRECT

  - name: 🔰国内免流
    type: select
    # disable-udp: true
    proxies:
      - DMIT
      - Home
      - DIRECT

  - name: ⚓️校园网直连
    type: select
    proxies:
      - DMIT
      - Home
      - DIRECT

